import React, { Component } from 'react'
import './infoArea.css'

class ProjImage extends Component {
    constructor(props){
        super(props);
      }
    render() {
        return (
            <div className="col-12 col-lg-5 p-0 mr-5  ">
                <img src={this.props.item.img} class="img-fluid" alt="Responsive image"/>
            </div>
        )
    }
}
export default ProjImage;
